import React from "react";
import "./Dashboard.css";

const courses = [
  { id: 1, title: "Intro to Computing", subtitle: "2SY2324 1_CS3B2" },
  { id: 2, title: "Data Structures", subtitle: "2SY2324 1_CS3B2" },
  { id: 3, title: "Math Electives", subtitle: "2SY2324 1_CS3B2" },
  { id: 4, title: "Programming 1", subtitle: "2SY2324 1_CS3B2" },
  { id: 5, title: "Programming 2", subtitle: "2SY2324 1_CS3B2" },
  { id: 6, title: "2SY2324 - THESIS 1_CS3B2", subtitle: "2SY2324 1_CS3B2" },
  { id: 7, title: "2SY2424 - THESIS 2_CS3B2", subtitle: "2SY2324 1_CS3B2" },
  { id: 8, title: "2SY2324 - THESIS 1_CS3B2", subtitle: "2SY2324 1_CS3B2" },
];

const Dashboard = () => {
  return (
    <div className="dashboard-container">
      <h2 className="dashboard-header">Dashboard</h2>
      <div className="dashboard-grid">
        {courses.map((course) => (
          <div key={course.id} className="dashboard-card">
            <div className="card-top"></div>
            <div className="card-content">
              <h3>{course.title}</h3>
              <p>{course.subtitle}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
